INSERT INTO `GrupoInvestigacion` VALUES (1,1,'Grupo de Magnetismo de Donostia-SS. Línea spintrónica','Grupo de Magnetismo de Donostia-SS. Línea spintrónica','Dinámica de imananción y spintrónica','Dinámica de imananción y spintrónica',2011,2018,'2018-03-07 15:43:55','2018-02-14 10:14:26',NULL),(3,4,'Materiales Magnéticos','Materiales Magnéticos + Tecnologías ( GMT)','Estudio de aleaciones metálicas amorfas y nanocristalinas ferromagnéticas\r\n(cintas, hilos y microhilos magnéticos) y metamateriales en el rango de\r\nmicroondas. Estos estudios abordan aspectos relativos a: Procesado mediante\r\ndiversas técnicas (tratamientos térmicos bajo tensión, campo magnético etc ),\r\nPropiedades Magnéticas (dinámica de movimiento de paredes, proceso de\r\nimanación biestable, fluctuaciones del campo switching, coercitividad,...),\r\nMagnetoelásticas (magnetostricción a saturación) y de Magnetotransporte\r\n(térmico o electrónico), Comportamiento electromagnético en alta frecuencia\r\nde micro-nanohilos y metamateriales (magnetoimpedancia gigante,\r\nresonancia ferromagnética) Aplicaciones como Sensores Magnéticos\r\n(codificación magnética, firma magnetoelástica…).','Estudio de aleaciones metálicas amorfas y nanocristalinas ferromagnéticas\r\n(cintas, hilos y microhilos magnéticos) y metamateriales en el rango de\r\nmicroondas. Estos estudios abordan aspectos relativos a: Procesado mediante\r\ndiversas técnicas (tratamientos térmicos bajo tensión, campo magnético etc ),\r\nPropiedades Magnéticas (dinámica de movimiento de paredes, proceso de\r\nimanación biestable, fluctuaciones del campo switching, coercitividad,...),\r\nMagnetoelásticas (magnetostricción a saturación) y de Magnetotransporte\r\n(térmico o electrónico), Comportamiento electromagnético en alta frecuencia\r\nde micro-nanohilos y metamateriales (magnetoimpedancia gigante,\r\nresonancia ferromagnética) Aplicaciones como Sensores Magnéticos\r\n(codificación magnética, firma magnetoelástica…).',2011,2018,'2018-02-22 15:04:19','2018-02-22 15:04:19',NULL),(4,1,'euskeras','euskeras','iker eus','iker eus',2015,2019,'2018-07-13 08:40:02','2018-07-13 08:40:02','2018-07-13 08:40:02'),(5,0,'aaaaaaaa','aaaaaaaa','aaaaaaa','aaaaaaa',2018,2019,'2018-07-13 08:43:16','2018-07-13 08:43:16',NULL),(6,1,'bbbb','bbbb','bbbbb','bbbbb',2019,2019,'2018-07-13 08:45:58','2018-07-13 08:45:58','2018-07-13 08:45:58'),(7,1,'tbrtntuy neit','tbrtntuy neit','tre biybnuebent','tre biybnuebent',2014,2018,'2018-07-26 10:42:58','2018-07-26 10:42:58',NULL),(8,1,'adsf','adsf','asdf','asdf',2017,2018,'2018-10-09 19:00:06','2018-10-09 19:00:06',NULL);
